import './styles.css'

const Game = () => {

    const [number, setNumber] = useState(0)



    useEffect(() => {
        setNumber(Math.floor(Math.random() * 100))
    }, [])

    return (
        <div className = 'game'>
            <div>
                <h1>{number}</h1>
            </div>
            <div>
                <button className = 'game_button' >-8</button>
                <button className = 'game_button'>-3</button>
                <button className = 'game_button'>-1</button>
            </div>

        </div>
    )
}

export default Game
